const HiraganaTestPage = ({ changeView }) => (

    <div>

        <GetHiraganaRomajiAndImage />

        <AddHiraganaScore />

        <p></p>
        <button onClick={() => changeView('mainMenu')}>Back To menu</button>

    </div>

    );


export default HiraganaTestPage;
